function ResetFun() {
  setCards(arr);
}

function shuffle() {
  let dup = cards.slice();
  for (let i = 0; i < cards.length; i++) {
    let rand = Math.floor(Math.random() * cards.length);

    [dup[i], dup[rand]] = [dup[rand], dup[i]];
  }

  setCards(dup);


}

function mix(Arr){
  let dup = Arr.slice();
  for (let i = 0; i < Arr.length; i++) {
    let rand = Math.floor(Math.random() * cards.length);

    [dup[i], dup[rand]] = [dup[rand], dup[i]];
  }
  return dup;
}


